"use client";
import React,{useState}from "react";
// import style from '@/app/component/Home/Home.module.css'
import CssBaseline from "@mui/material/CssBaseline";
import Box from "@mui/material/Box";
import Container from "@mui/material/Container";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import { styled } from "@mui/material/styles";
import { purple } from "@mui/material/colors";
import BasicModal from "../ModalComp/Modal";
import Spinner from "@/app/component/Spinner/Spinner";
// import HeartAnimation from "../HeartAnimation/Heart";


const Home = () => {
const [ModalHandler, setModalHandler] = useState(false);
const [SpinnerShow , setSpinner] = useState(false)
const [Name,setName] = useState()
const ModalShowhandler = () => {
    setSpinner(true);
    // After 1 second, set the ModalHandler to true
    setTimeout(() => {
      setSpinner(false);
      setModalHandler(true);
    }, 1000);
  };

  const BootstrapButton = styled(Button)({
    boxShadow: "true",
    textTransform: "none",
    fontSize: 16,
    padding: "6px 12px",
    border: "1px solid",
    lineHeight: 1.5,
    backgroundColor: "#0063cc",
    borderColor: "#0063cc",
    fontFamily: [
      "-apple-system",
      "BlinkMacSystemFont",
      '"Segoe UI"',
      "Roboto",
      '"Helvetica Neue"',
      "Arial",
      "sans-serif",
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"'
    ].join(","),
    "&:hover": {
      backgroundColor: "#0069d9",
      borderColor: "#0062cc",
      boxShadow: "none"
    },
    "&:active": {
      boxShadow: "none",
      backgroundColor: "#0062cc",
      borderColor: "#005cbf"
    },
    "&:focus": {
      boxShadow: "0 0 0 0.2rem rgba(0,123,255,.5)"
    }
  });

  const ColorButton = styled(Button)(({ theme }) => ({
    color: theme.palette.getContrastText(purple[500]),
    backgroundColor: purple[500],
    "&:hover": {
      backgroundColor: purple[700]
    }
  }));

  return (
    <div>
    <BasicModal setModalHandler={setModalHandler} ModalHandler={ModalHandler} Name={Name}/>
      <CssBaseline />
      <Container maxWidth="sm" style={{ alignItems: "center" }}>
        <Box
          sx={{
              backgroundSize: "cover",
              backgroundImage:
              "url('data:image/png;base64,')",
            bgcolor: "#cfe8fc",
            height: "60vh",
            "& .MuiTextField-root": { m: 1, width: "10ch" }
          }}
          mt={7}
        >     
          <h2
            style={{
              color: "red",
              textAlign: "center",
              marginTop: "red",
              margin: "auto"
            }}
          >
        
            Please Enter Your name <br />

            <TextField
              id="standard-multiline-flexible"
              label="Name"
              maxRows={1}
              variant="standard"
              color="warning"
              focused 
              inputProps={{ style: { color: 'red' }}}
              onChange={(event)=>{setName(event.target.value.toUpperCase())}}
              />

            <br />
            <ColorButton variant="contained" onClick={ModalShowhandler}>Click Me</ColorButton>
              
              {SpinnerShow ?  <Spinner/>:"" }
          </h2>
        </Box>
      </Container>
    </div>
  );
};

export default Home;
